import React, { useRef } from "react";

const Input = (props) => {
  return (
    <div>
      <input
        type="text"
        placeholder="Ethereum Address"
        ref={(node) => (this.inputNode = node)}
      />
      <button
        type="submit"
        onClick={() => {
          props.triggerFetch(this.inputNode.value);
        }}
      >
        Submit
      </button>
    </div>
  );
};

export default Input;
